import React from 'react';
import firebase from '../firebase';

class Login extends React.Component {

  signUp() {
    const email = document.querySelector('#email').value;
    const password = document.querySelector('#password').value;
    firebase.auth().createUserWithEmailAndPassword(email, password)
      .then((u) => {
        console.log('Successfully Signed Up');
        alert('Successfully Signed Up');
      })
      .catch((err) => {
        console.log('Error: ' + err.toString());
        alert('Error: ' + err.toString());
      })
  }

  login() {
    const email = document.querySelector('#email').value;
    const password = document.querySelector('#password').value;
    firebase.auth().signInWithEmailAndPassword(email, password)
      .then((u) => {
        console.log('Successfully Logged In');
        alert('Successfully Logged In');
        
      })
      .catch((err) => {
        console.log('Error: ' + err.toString());
        alert('Error: ' + err.toString());
      })
  }

  render() {
    return (
      <div className="logform" style={{ textAlign: 'center' }}>
          <div><h2>SHOENIQUE</h2></div>
        <div>
          <input className="email1" id="email" placeholder="Enter Email.." type="text"/>
        </div>
        <div>
          <input className="password1" id="password" placeholder="Enter Password.." type="password"/>
        </div>
        <button style={{margin: '10px'}} onClick={this.login}>Login</button><br></br>
        <button style={{margin: '10px'}} onClick={this.signUp}>Sign Up</button>
        
      </div>
    )
  }
}

export default Login;
